class TorchResource:

    def __init__(self):
        logger.info("...")
        logger.info("###")

    def on_option(self, req, resp):
        logger.info("...")
        resp.set_header('Access-Control-Allow-Origin', 'http://www.tsinghuaoby.com')
        resp.set_header('Access-Control-Allow-Methods', '*')
        resp.set_header('Access-Control-Allow-Headers', '*')
        resp.set_header('Access-Control-Allow-Credentials', 'true')

    def getData(self, type):
        if type == "0":
            lines = bio

        if type == '1':
            lines = acdemic_news

        if type == '2':
            lines = competetional_news

        if type == '3':
            lines = non_academic_news + zhiyuan_data_2021#nature_dl_t + # + xiaoy_data_t

        if type == '4':
            lines = code_news

        if type == '5':
            lines = model_pretrained

        if type == '6':
            lines = model_presentation

        if type == '7':
            lines = cooperation_inviting

        return lines

    def on_get(self, req, resp):
        logger.info("...")
        origin = req.headers.get('Origin','http://www.tsinghuaboy.com')
        print(origin)
        resp.set_header('Access-Control-Allow-Origin', origin)
        resp.set_header('Access-Control-Allow-Methods', '*')
        resp.set_header('Access-Control-Allow-Headers', '*')
        resp.set_header('Access-Control-Allow-Credentials', 'true')
        line = req.get_param('text', True)
        lines = self.getData(line)
        resp.media = lines
        logger.info("###")

    def on_post(self, req, resp):
        """Handles POST requests"""
        origin = req.headers.get('Origin','http://www.tsinghuaboy.com')
        print(origin)
        resp.set_header('Access-Control-Allow-Origin', origin)
        resp.set_header('Access-Control-Allow-Methods', '*')
        resp.set_header('Access-Control-Allow-Headers', '*')
        resp.set_header('Access-Control-Allow-Credentials', 'true')
        resp.set_header("Cache-Control", "no-cache")
        start = ft()
        jsondata = json.loads(req.stream.read(req.content_length))
        line=jsondata['text']
        lines = self.getData(line)
        resp.media = lines
        logger.info("tot:{}ns".format(ft() - start))
        logger.info("###")

statefile='state.csv'
class StateResource:

    def __init__(self):
        logger.info("...")
        logger.info("###")
        if os.path.isfile(statefile):
            self.df = pandas.read_csv(statefile)
        else:
            self.df = pandas.DataFrame()


    def on_get(self, req, resp):
        logger.info("...")
        origin = req.headers.get('Origin','http://www.tsinghuaboy.com')
        # print(origin)
        resp.set_header('Access-Control-Allow-Origin', origin)
        resp.set_header('Access-Control-Allow-Methods', '*')
        resp.set_header('Access-Control-Allow-Headers', '*')
        resp.set_header('Access-Control-Allow-Credentials', 'true')
        now = time.time()
        self.df = self.df.append({'time':now},ignore_index=True)
        self.df.to_csv('state.csv',index=False)
        resp.media = len(self.df)
        logger.info("###")


